import React from 'react'
import Plot from 'react-plotly.js';
import styled from 'styled-components';
import { InfoConsumer } from '../Context';


var data = [
    {
      "type": "sunburst",
      "labels": ["Skills", "Front-End","Back-End","Data-Base","ETL",
                "Libs","Languages","Back-End-Languages","Back-End-Frameworks","relational","Non Relational","ETL<br>Framework","Tool",
                "ReactJs","Jquery","Bootstrap","PlotlyJs","CSS","HTML","XML","Js","Java"],

      "parents": ["", "Skills", "Skills","Skills","Skills",
                 "Front-End","Front-End","Front-End","Back-End","Back-End","Data-Base","Data-Base","ETL","ETL",
                 "Libs","Libs","Libs","Languages","Languages","Languages","Languages","Back-End-Languages"],

      "values":  [100, 0, 0, 0, 0, 0, 10, 10, 10,10,10,10,10,10,10,10,10,10,10,10,10,10],
      "leaf": {"opacity": 0.4},
      "marker": {"line": {"width": 3}},
    }];

    var layout = {
      "margin": {"l": 0, "r": 0, "b": 0, "t": 0},
    };
function Skills() {

    return (
        <InfoConsumer>
        {value => {
          const {
            headerDetailTitle,
            headerDetailSubTitle,
            description,
          } = value.infoDetails;

          return (
            <React.Fragment>
              <SkillsDetails className="conteiner-fluid align-items-center">
              <Plot data={data} layout={layout}/>
              </SkillsDetails>
            </React.Fragment>
          );
        }}
      </InfoConsumer>
    )
}
export default Skills;

const SkillsDetails = styled.body`
  background: linear-gradient(rgba(109, 109, 109), rgba(255, 255, 255));
  height: 100vh;
  text-transform: uppercase;
  color: var(--mainWhite);
  text-align: center;
  h1 {
    padding-top: 10%;
    color: var(--mainDark);
  }
  h4 {
    color: var(--mainDark);
  }
  p {
    padding-left: 10%;
    padding-right: 10%;
    margin-bottom: 2%;
    color: var(--mainDark);
  }
  button {
    color: var(--mainWhite);
    background: var(--mainDark);
    margin-bottom: 8%;
  }
  button:hover {
    background: var(--mainBlue)
  }
  i {
    font-size: 1.875rem;
    color: var(--mainDark);
  }
  i:hover {
    color: var(--mainBlue);
    cursor: pointer;
  }
  .nav-item {
    height: 18.75rem;
  }
  @media (max-width: 760px) {
    h1,
    h4 {
      color: var(--mainWhite);
    }
  }
`;
